import React from 'react';
import Modal from '../Modal';

const StreamDelete = () => {
    return (
        <div>
            Delete Stream
            <Modal>
                <div className="header">Delete Stream</div>
                <div className="content">Are you sure you wannt to delete this stream?</div>
            </Modal>
        </div>
    );
}

export default StreamDelete;
